import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import cards from "./dragonBall.json";

class App extends Component {

  state = {
    dragonBall,
  };


  render() {
    return (
      <div className="App">
       <Wrapper>
          {this.state.pups.map(puppy => (
            <Card
              shuffleScoreCard={this.shuffleScoreCard}
              id={puppy.id}
              key={puppy.id}
              image={puppy.image}
            />
          ))}
        </Wrapper>
      </div>
    );
  }
}

export default App;
